	private String description;
	private String code;
	
	private SICCode(String code, String description)
	{
		this.code=code;
		this.description=description;
	}

	public String getDescription() {
		return description;
	}

	public String getCode() {
		return code;
	}

	public static SICCode getSICFromCode(String code)
	{
		for(SICCode c : SICCode.values())
		{
			if(c.getCode().equalsIgnoreCase(code))
				return c;
		}
		return null;
	}
	
	@Override
	public String toString()
	{
		return code + " - " + description;
	}
